import { Menu } from 'antd';
import React from 'react'
import './Navbar2.css'
const { SubMenu } = Menu;

class Navbar2 extends React.Component {
  // state = {
  //   current: 'mail',
  // };

  // handleClick = e => {
  //   console.log('click ', e);
  //   this.setState({ current: e.key });
  // };

  render() {
   // const { current } = this.state;
    return (
     <div>

        <div className="logo">
            <i>LOGO</i>
        </div>
     
      <Menu  mode="horizontal" className="center dropdown">
      
        <Menu.Item key="app" className="menu-item">
          Home
        </Menu.Item>
        <SubMenu title="shop" className="menu-item ">
          <Menu.ItemGroup title="women" >
            <Menu.Item key="setting:1"> 1</Menu.Item>
            <Menu.Item key="setting:2">2</Menu.Item>
          </Menu.ItemGroup>
          <Menu.ItemGroup title="men">
            <Menu.Item key="setting:3" > 3</Menu.Item>
            <Menu.Item key="setting:4">4</Menu.Item>
          </Menu.ItemGroup>
          <Menu.ItemGroup title="kids">
            <Menu.Item key="setting:3">O 3</Menu.Item>
            <Menu.Item key="setting:4">O 4</Menu.Item>
          </Menu.ItemGroup>
        </SubMenu>
        <Menu.Item key="alipay" >
          <a href="https://ant.design" target="_blank" rel="noopener noreferrer">
           Contact us
          </a>
        </Menu.Item>
      </Menu></div>
    );
  }
}

export default Navbar2
